import React from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Login from ".././screens/login/Components/Login";
import ForgotPassword from ".././screens/forgotPassword/Components/ForgotPassword";
import Register from ".././screens/register/Components/Register"
import Home from ".././screens/home/Component/Home";
import Profile from ".././screens/profile/Components/Profile";
import FeedMain from ".././screens/feeds/Components/FeedMain";
import PrivateRoute from ".././layout/private/PrivateRoute";
import PublicRoute from ".././layout/public/PublicRoute";


const Navigation = () =>{

    return (
        <BrowserRouter>
          <Switch>
            < exact path = "/home" component = {Home}/>
            <Route exact path = "/register" component = {Register}/>
            <Route exact path = "/forgotpassword" component = {ForgotPassword} />
            <Route exact path = "/login" component  = {Login}/>
            <Route exact path = "/profile" component = {Profile}/>
            <Route exact path = "/feeds" component = {FeedMain}/>
          </Switch>
        </BrowserRouter>
      );
}

export default Navigation;
